    const [users, setusers] = useState([])
    const x = 0;
    useEffect(() => {

        axios.get('http://localhost:5000/user')
            .then((res) => {
                setusers(res.data)

            })
            .catch((err) => console.log(err))

    }, [])



    const viewImage = users.length > 0 ? <img src={process.env.REACT_APP_AVATAR + users[0].avatar} alt={users[0]._id} /> : null


    return (
        <div>
            <h1>hello in sign in</h1>
            {
                viewImage
